her 3 which all needed taking out. Within one week I had my teeth out and a denture plate put in which looks better then my original crown. (They had been In 34 years). I am now waiting to have my implant put in but have to wait for my gums to heal.Great service every member of staff helpful and plesent</span> </div> </div> </div> <div class="wp-google-review "> <div class="wp-google-left"> <img loading="lazy" src="https://lh3.googleusercontent.com/a-/ALV-UjVJV5OOebYbIdjZKp1T7Nxdb_BzzvU-PeXSASebk4z8QU4=s128-c0x00000000-cc-rp-mo-ba3" alt="Nikos Kouvatsos" onerror="if(this.src!='https://lh3.googleusercontent.com/-8hepWJzFXpE/AAAAAAAAAAI/AAAAAAAAAAA/I80WzYfIxCQ/s64-c/114307615494839964028.jpg')this.src='https://lh3.googleusercontent.com/-8hepWJzFXpE/AAAAAAAAAAI/AAAAAAAAAAA/I80WzYfIxCQ/s64-c/114307615494839964028.jpg';"> </div> <div class="wp-google-right"> <a href="https://www.google.com/maps/contrib/106423708126104409785/reviews" class="wp-google-name" target="_blank" rel="nofollow">Nikos Kouvatsos</a> <div class="wp-google-time" data-time="1697478720">17:52 16 Oct 23</div> <div class="wp-google-feedback"> <span class="wp-google-stars"><span class="wp-stars"><span class="wp-star"><svg xmlns="http://www.w3.org/2000/svg" version="1.1" width="17" height="17" viewBox="0 0 1792 1792"><path d="M1728 647q0 22-26 48l-363 354 86 500q1 7 1 20 0 21-10.5 35.5t-30.5 14.5q-19 0-40-12l-449-236-449 236q-22 12-40 12-21 0-31.5-14.5t-10.5-35.5q0-6 2-20l86-500-364-354q-25-27-25-48 0-37 56-46l502-73 225-455q19-41 49-41t49 41l225 455 502 73q56 9 56 46z" fill="#e7711b"></path></svg></span><span class="wp-star"><svg xmlns="http://www.w3.org/2000/svg" version="1.1" width="17" height="17" viewBox="0 0 1792 1792"><path d="M1728 647q0 22-26 48l-363 354 86 500q1 7 1 20 0 21-10.5 35.5t-30.5 14.5q-19 0-40-12l-449-236-449 236q-22 12-40 12-21 0-31.5-14.5t-10.5-35.5q0-6 2-20l86-500-364-354q-25-27-25-48 0-37 56-46l502-73 225-455q19-41 49-41t49 41l225 455 502 73q56 9 56 46z" fill="#e7711b"></path></svg>