name" target="_blank" rel="nofollow">Niall Hales</a> <div class="wp-google-time" data-time="1678583513">01:11 12 Mar 23</div> <div class="wp-google-feedback"> <span class="wp-google-stars"><span class="wp-stars"><span class="wp-star"><svg xmlns="http://www.w3.org/2000/svg" version="1.1" width="17" height="17" viewBox="0 0 1792 1792"><path d="M1728 647q0 22-26 48l-363 354 86 500q1 7 1 20 0 21-10.5 35.5t-30.5 14.5q-19 0-40-12l-449-236-449 236q-22 12-40 12-21 0-31.5-14.5t-10.5-35.5q0-6 2-20l86-500-364-354q-25-27-25-48 0-37 56-46l502-73 225-455q19-41 49-41t49 41l225 455 502 73q56 9 56 46z" fill="#e7711b"></path></svg></span><span class="wp-star"><svg xmlns="http://www.w3.org/2000/svg" version="1.1" width="17" height="17" viewBox="0 0 1792 1792"><path d="M1728 647q0 22-26 48l-363 354 86 500q1 7 1 20 0 21-10.5 35.5t-30.5 14.5q-19 0-40-12l-449-236-449 236q-22 12-40 12-21 0-31.5-14.5t-10.5-35.5q0-6 2-20l86-500-364-354q-25-27-25-48 0-37 56-46l502-73 225-455q19-41 49-41t49 41l225 455 502 73q56 9 56 46z" fill="#e7711b"></path></svg></span><span class="wp-star"><svg xmlns="http://www.w3.org/2000/svg" version="1.1" width="17" height="17" viewBox="0 0 1792 1792"><path d="M1728 647q0 22-26 48l-363 354 86 500q1 7 1 20 0 21-10.5 35.5t-30.5 14.5q-19 0-40-12l-449-236-449 236q-22 12-40 12-21 0-31.5-14.5t-10.5-35.5q0-6 2-20l86-500-364-354q-25-27-25-48 0-37 56-46l502-73 225-455q19-41 49-41t49 41l225 455 502 73q56 9 56 46z" fill="#e7711b"></path></svg></span><span class="wp-star"><svg xmlns="http://www.w3.org/2000/svg" version="1.1" width="17" height="17" viewBox="0 0 1792 1792"><path d="M1728 647q0 22-26 48l-363 354 86 500q1 7 1 20 0 21-10.5 35.5t-30.5 14.5q-19 0-40-12l-449-236-449 236q-22 12-40 12-21 0-31.5-14.5t-10.5-35.5q0-6 2-20l86-500-364-354q-25-27-25-48 0-37 56-46l502-73 225-455q19-41 49-41t49 41l225 455 502 73q56 9 56 46z" fill="#e7711b"></path></svg></span><span class="wp-star"><svg xmlns="http://www.w3.org/2000/svg" version="1.1" width="17" height="17" viewBox="0 0 1792 1792"><path d="M1728 647q0 22-26 48l-363 354 86 500q1 7 1 20 0 21-10.5 35.5t-30.5 14.5q-19 0-40-12l-449-236-449 236q-22 12-40 12-21 0-31.5-14.5t-10.5-35.5q0-6 2-20l86-500-364-354q-25-27-25-48 0-37 56-46l502-73 225-455q19-41 49-41t49 41l225 455 502 73q56 9 56 46z" fill="#e7711b"></path></svg></span></span></span> <span class="wp-google-text">I'm not one to give a 5 star review but what a Dentist this is!My 1st visit here (being nervous from mistreatment from my usual) I was greeted by Greta with a smile from the get go she was really engaging!, We didn't have a full conversation but she was nice and made me feel welcome as soon as I entered!I was seen by Susie to which I have got to say is the most professional but down to earth dentist I've had to date, Susie was informative - knowledgeable and attentive to any questions I presented her.She explained every step start to finish and advised thoroughly the importance and key tips to keeping a good hygiene, not only this she had explained the importance of a plan and how it would work over the course of the next few months.I had made a comment about my practice not being as helpful as they should be and me being disappointed about me not receiving this level of service from my usual dentist, Susie kept her professionalism in regards to this and focused on the task at hand!.If you are going to invest your money into a business that runs like clockwork, I suggest you do so here - you're paying for a service not only from a dental standpoint but also a customer service standpoint.I thought the reviews was good to be true, I'm pleased that I was proven wrong.Thank you Susie and team; I look forward to my next visit!</span> </div> </div> </div> <div class="wp-google-review "> <div class="wp-google-left"> <img loading="lazy" src="https://lh3.googleusercontent.com/a/AAcHTtekwP9Gj1XarZjOFfo017XozVUaamp50zjeRXRVAGBh=s128-c0x00000000-cc-rp-mo" alt="Traci Cowsill" onerror="if(this.src!='https://lh3.googleusercontent.com/-8hepWJzFXpE/AAAA