 Ringway Dental an absolute pleasure. He is a genuinely nice guy! I will not have any other dentist touch my teeth.Overall Ringway Dental continue to provide consistent, exceptional, high end stellar service.If you are looking for outstanding customer service and care from a group of exceptional passionate professionals then I highly recommend visiting Ringway Dental.</span> </div> </div> </div> <div class="wp-google-review "> <div class="wp-google-left"> <img loading="lazy" src="https://lh3.googleusercontent.com/a/AItbvmnVktuq7w27__DENNskH4EGvplF4ONAEDwKyDkb=s128-c0x00000000-cc-rp-mo" alt="Karen Sandler" onerror="if(this.src!='https://lh3.googleusercontent.com/-8hepWJzFXpE/AAAAAAAAAAI/AAAAAAAAAAA/I80WzYfIxCQ/s64-c/114307615494839964028.jpg')this.src='https://lh3.googleusercontent.com/-8hepWJzFXpE/AAAAAAAAAAI/AAAAAAAAAAA/I80WzYfIxCQ/s64-c/114307615494839964028.jpg';"> </div> <div class="wp-google-right"> <a href="https://www.google.com/maps/contrib/113459168507725761430/reviews" class="wp-google-name" target="_blank" rel="nofollow">Karen Sandler</a> <div class="wp-google-time" data-time="1658519886">19:58 22 Jul 22</div> <div class="wp-google-feedback"> <span class="wp-google-stars"><span class="wp-stars"><span class="wp-star"><svg xmlns="http://www.w3.org/2000/svg" version="1.1" width="17" height="17" viewBox="0 0 1792 1792"><path d="M1728 647q0 22-26 48l-363 354 86 500q1 7 1 20 0 21-10.5 35.5t-30.5 14.5q-19 0-40-12l-449-236-449 236q-22 12-40 12-21 0-31.5-14.5t-10.5-35.5q0-6 2-20l86-500-364-354q-25-27-25-48 0-37 56-46l502-73 225-455q19-41 49-41t49 41l225 455 502 73q56 9 56 46z" fill="#e7711b"></path></svg></span><span class="wp-star"><svg xmlns="http://www.w3.org/2000/svg" version="1.1" width="17" height="17" viewBox="0 0 1792 1792"><path d="M1728 647q0 22-26 48l-363 354 86 500q1 7 1 20 0 21-10.5 35.5t-30.5 14.5q-19 0-40-12l-449-236-449 236q-22 12-40 12-21 0-31.5-14.5t-10.5-35.5q0-6 2-20l86-500-364-354q-25-27-25-48 0-37 56-46l502-73 225-455q19-41 49-41t49 41l225 45