<h2>MEET THE TEAM</h2>
<h3>DR STEPHEN DODD</h3>
<h4>Principal Dentist</h4>
<p>With a special interest in cosmetic and implant dentistry, Dr. Dodd is a refreshing figure in dentistry. Since becoming the owner of Ringway Dental in February 2021, he has completely transformed its image making it a hub for skilled general and cosmetic treatment, as well as <a href="dental-implants-manchester/">dental implants</a>.</p>
<p>Fired by a belief that a trip to the dentist should be an experience – rather than a chore – Dr. Dodd started in private practice in 2008. Graduating from the <a href="https://www.manchester.ac.uk/" target="_blank" rel="nofollow">University of Manchester</a> in 2007, he has a Masters in Restorative Cosmetic Dentistry and a Diploma in Implantology both from the <a href="https://www.uclan.ac.uk/" target="_blank" rel="nofollow">University of Central Lancashire</a> (UCLan).</p>

